  \"2013-03-15T23:29:13.441228\",\n\t\"name\": \"reconnaissance-investigation-of-sand-gravel-and-quarried-bedrock-resources-in-the-shelton-1-97\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During its 1998 session, the Washington
  State Legislature, acting on a recommendation from the Governor's Land Use Study
  Commission, asked the Washington Department of Natural Resources (W ADNR) to map
  sand and gravel and bedrock resources that are used for maintenance and construction
  of homes and infrastructure. The Study Commission sought information to assess the
  need to protect these resources from urban sprawl and other intensive land uses.
  These data would, in turn, result in better long-range planning and possible legislation
  to aid in designating mineral resource lands under the Growth Management Act (Revised
  Code of Washington [RCW] 36.70A; Lingley and Lazdzewski, 1994).nnAlthough the data
  we present herein are in the traditional text and map format, this report is part
  of a project to prepare a geographic information system (GIS) database that delineates
  the locations of some of the significant construction aggregate resources (sand,
  gravel, and quarried bedrock) of Washington State. The digital version of this report,
  including ArcInfo coverages, is available through the Washington Division of Geology
  and Earth Resources.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
